CREATE TABLE person (
  id INTEGER NOT NULL,
  name VARCHAR(40),
  PRIMARY KEY (id)
);
CREATE INDEX person_name ON person(name);

CREATE TABLE movie (
  id INTEGER,
  title VARCHAR(80),
  yr NUMERIC(4),
  score FLOAT,
  votes INTEGER DEFAULT 0,
  directorid INTEGER,
  PRIMARY KEY (id),
  FOREIGN KEY (directorid) REFERENCES person(id)
);
CREATE INDEX movie_title ON movie(title);

CREATE TABLE casting (
  movieid INTEGER NOT NULL,
  actorid INTEGER NOT NULL,
  ord INTEGER,
  PRIMARY KEY (movieid, actorid),
  FOREIGN KEY (movieid) REFERENCES movie(id),
  FOREIGN KEY (actorid) REFERENCES person(id)
);
CREATE INDEX casting_movie  ON casting(movieid);
CREATE INDEX casting_person ON casting(actorid);
CREATE INDEX casting_ord    ON casting(ord);



